export default function Users({usersData}) {
    const users = usersData || [{
        first_name: 'Sam',
        avatar: 'http://placekitten.com/200/300',
        city: 'New York'
    }]
    const CardGenerator = () => {

        const Card = ({user}) => {
            return (
                <div style={{flex: '0 0 auto'}} className='pl-4 pt-4'>
                    <img src={users[i].avatar} className='w-32 h-32 rounded-full'/>
                    <h3 className="text-2xl font-f1 font-bold">{users[i].first_name}</h3>
                </div>
            )
        }
        const cards = users.map((user, i) => (<Card user={user} id={i} />))
        return cards

    }
    return(
        <div className="flex flex-no-wrap overflow-auto">
            <CardGenerator />
        </div>
    )
}
